import React from 'react';

function Pokemon({data}) {

    return(
        <div className='poke'>
            <div className='leftSide'>
                <img className='pokepic' src={data.sprites.front_default} alt='Missing Img'></img>
                <h1 className='pokeName'>{data.name.toUpperCase()}</h1>
                <h4>Poke ID: {data.id}</h4>
            </div>
            <div className="rightSide">
                <p>Poke Type 1: {data['types']['0']['type']['name']}</p>
                {/* <p>Poke Type 1: {data['types']['1']['type']['name']}</p> */}
                <p>Speed: {data['stats']['0']['base_stat']}</p>
                <p>Special Def: {data['stats']['1']['base_stat']}</p>
                <p>Special Atk: {data['stats']['2']['base_stat']}</p>
                <p>Defense: {data['stats']['3']['base_stat']}</p>
                <p>Attack: {data['stats']['4']['base_stat']}</p>
                <p>Starting HP: {data['stats']['5']['base_stat']}</p>
            </div>
        </div>
    )
}


export default Pokemon;
